import './App.css';
const cheerio = require('cheerio')
const axios = require('axios')


function App() {

  axios
  .get("https://www.espncricinfo.com/")
  .then((response) => {
    const $ = cheerio.load(response.data);
    const dd = $(".ds-rounded-xl")
    console.log(dd.html())

  })
  .catch((err) => console.log("Fetch error " + err));

  return (
   <div>
      <h1>Hello World</h1>
   </div>
  );
}

export default App;
